import React from "react";

// reactstrap components
import {
  Button,
  NavItem,
  NavLink,
  Nav,
  TabContent,
  TabPane,
  Container,
  Row,
  Col,
  Table,
  Card,
  CardHeader,
  CardBody,
  UncontrolledTooltip
} from "reactstrap";

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import ProfilePageHeader from "components/Headers/ProfilePageHeader.js";
import DefaultFooter from "components/Footers/DefaultFooter.js";


function State() {
  const [pills, setPills] = React.useState("2");
  React.useEffect(() => {
    document.body.classList.add("profile-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    window.scrollTo(0, 0);
    document.body.scrollTop = 0;
    return function cleanup() {
      document.body.classList.remove("profile-page");
      document.body.classList.remove("sidebar-collapse");
    };
  }, []);


  return (
    <>
      <ExamplesNavbar />
      <div className="wrapper">
        <ProfilePageHeader />
        <div className="section">

          <Container>
            {/* parks define by state */}
            <h3 className="title">Parks</h3>
            <Card>
              <CardHeader>Some Table</CardHeader>
              <CardBody>
                <div style={{
                  maxHeight: '200px',
                  overflowY: 'auto'
                }}>
                  <Table bordered height="200">
                    <thead>
                      <tr>
                        <th>#</th>
                        <th>Park Code</th>
                        <th>Last Name</th>
                        <th>Username</th>
                      </tr>
                    </thead>
                    <tbody>
                    </tbody>
                  </Table>
                </div>
              </CardBody>
            </Card>
            <h3 className="title">Parks</h3>
            <h3 className="title">Species Distribution</h3>
            <Table>
              <thead>
                <tr>
                  <th scope="col">Park Code</th>
                  <th scope="col">Park Name</th>
                  <th scope="col">Number of Species</th>
                </tr>
              </thead>
              <tbody>

              </tbody>
            </Table>
          </Container>
        </div>
        <DefaultFooter />
      </div>
    </>
  );
}

export default State;
